import logo from './logo.svg';
// import './App.css';
import Header from "./components/header/header"
import WilderCard from './components/wilder_card/wilder_card';

function App() {
  return (
    <div>
      <Header />
      <main>
        <h2>Wilders</h2>
        <section>
          <WilderCard />
        </section>
      </main>
    </div>
  );
}

export default App;
